import React from 'react'
import Product from './Product'
import{ Grid ,Box,} from '@material-ui/core'
import product1 from "../Assets/Products/product1.jpg";
import product2 from "../Assets/Products/product2.jpg";
import product3 from "../Assets/Products/product3.jpg";
import product4 from "../Assets/Products/product4.jpg";
import product5 from "../Assets/Products/product5.jpg";
import product6 from "../Assets/Products/product6.jpg";
import product7 from "../Assets/Products/product7.jpg";
import product8 from "../Assets/Products/product8.jpg";
import product9 from "../Assets/Products/product9.jpeg";
import { makeStyles } from "@material-ui/core/styles";


const useStyles = makeStyles({
  center:{
    display:'flex',
    justifyContent:'center',
    marginTop:"10vh"
    
  }
})

const cards = [
    {
      id: 1,
      img: product1,
      title: "hgvhgc",
      description: "vghcg",
    },
    {
      id: 2,
      img: product2,
      title: "hgvhgc",
      description: "vghcg",
    },
    {
      id: 3,
      img: product3,
      title: "hgvhgc",
      description: "vghcg",
    },
    {
      id: 4,
      img: product4,
      title: "hgvhgc",
      description: "vghcg",
    },
    {
      id: 5,
      img: product5,
      title: "hgvhgc",
      description: "vghcg",
    },
    {
      id: 6,
      img: product6,
      title: "hgvhgc",
      description: "vghcg",
    },
    {
      id: 7,
      img: product7,
      title: "hgvhgc",
      description: "vghcg",
    },
    {
      id: 8,
      img: product8,
      title: "hgvhgc",
      description: "vghcg",
    },
    {
      id: 9,
      img: product9,
      title: "hgvhgc",
      description: "vghcg",
    },
  ];
 

const Products = () => {
  const classes = useStyles();
    return (
        <Box display='flex'>
        <Grid container spacing={5} className={classes.center} >
            
            {cards.map((card,id) => {
                return(
                   <Grid  key={id} item> <Product  {...card}/> </Grid>
                )
              }
            )
            }
            
        </Grid>
        </Box>
    )
}

export default Products
